// SPDX-License-Identifier: UNLICENSED

pragma solidity ^0.8.3;
import './Dai.sol';

contract EthPool {
    string public name;
    address admin;
    DaiToken public daiToken;

    constructor(DaiToken _daiToken) {
        name = 'EthPool';
        admin = msg.sender;
        daiToken = _daiToken;
    }

    struct Deposits {
        address deposit_address;
        uint amount;
        uint time;
    }

    mapping(address => Deposits) public depositers;

    //Deposit Eth into contract
    function EthDeposit() external payable {
       depositers[msg.sender] = Deposits(msg.sender, msg.value, block.timestamp);
    }

    receive() external payable {}
  
    function balanceOf() external view returns (uint) {
        return address(this).balance;
    }

    function depositRewards(uint _amount) public {
        require(msg.sender == admin);
        daiToken.transfer(address(this), _amount);

    }


}

